experience.description:
Start up de la Civic Tech.  Plateforme numérique de participation citoyenne

-	Développement des partenariats stratégiques ; 
-	Élaboration et pilotage de la stratégie de prospection et d’influence en France ;
-	Responsable commerciale : clients publics (collectivités, Etat, députés, Union Européenne : réponses à marchés publics locaux, nationaux et européens, prospection directe...) et leurs partenaires privés (promoteurs, aménageurs, cabinets de concertation et de conseil…) ;
-	Fonctions transverses : représentation de Fluicity dans des conférences et salons, élaboration des process internes, évolutions produit.

Insertion sociale et professionnelle (RSA), insertion par le logement (FSL, accès au logement, prévention des expulsions), urgence sociale, prévention spécialisée 

-	Pilotage fonctionnel de la sous-direction : gestion des finances (450 millions d’euros de budget) et des RH (315 agents dont 230 dans des services de terrain) ; gestion des projets SI ; rapports d’activité ; élaboration et suivi des marchés publics ; suivi des délibérations et des conventions / CPOM ; tarification ;

-	Gestion de grands projets avec une forte dimension partenariale (Pôle Emploi, PLIE, Mission Locale, CAF, DIRECCTE, secteur associatif) : Pacte de lutte contre la grande exclusion, grande cause de la mandature ; Plan Départemental de l’Insertion par l’Emploi ; Contrats aidés ; Financements européens ;

-	Intérim de la sous-directrice.

Mise en place d’une démarche globale de suivi et de contrôle des principaux partenaires départementaux :

-	30aine de structures : Etablissements Publics, SEM, SPL, Syndicats Mixtes, Associations intervenant dans les champs du tourisme, du développement économique, de la protection de l’enfance, de l’aménagement et du logement ; 
200 millions d’euros de financement départemental annuel ;

-	pilotage et aide à la décision, audits financiers, évaluations d’activité, gestion des risques financiers, juridiques et politiques, élaboration et suivi de conventions…

Encadrement du service
